import React from "react";
import "./style.css";

function SubFooter() {
  return (
    <div>
      <div className="SubFooter">
        <div>
          <div class="row">
            <div class="col-md-12">
              <p className="SubFooterText">
                The Most Efficient Finder For All Your Medical & Pharmaceutical
                Needs
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default SubFooter;
